import React from 'react';

const DogCard = ({dog, toggleFav, isFav}) => {
   return (
    <div className="dog-card">
        <img src={dog-img.jpeg} alt={dog.name} />
        <h3>{dog.name}</h3>
        <p>Breed: {dog.breed}</p>
        <p>Age: {dog.age}</p>
        <p>Location: {dog.zip_code}</p>
        <button onClick={() => toggleFav(dog)}>
            {isFav ? 'Unfavorite' : 'Favorite'}
        </button>
    </div>
   );
};

export default DogCard;
